  \"Vocal Anuran Community Monitoring with Automatic Recording Devices at  Swanquarter
  National Wildlife Refuge:  Summary Report  2014\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-11-15T20:04:56.441397\",\n\t\"name\": \"vocal-anuran-community-monitoring-with-automatic-recording-devices-at-swanquarter-national\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During 2014, the Southeast Region Inventory
  and Monitoring Branch conducted the first vocal anuran monitoring at Swanquarter
  National Wildlife Refuge.  The methodology and data analysis were conducted in accordance
  with the National Park Service Southeast Coast Network Inventory and Monitoring
  Branchu2019s protocol for monitoring vocal anuran communities. Ten Wildlife Acoustic
  SM2+ automatic recording devices were deployed from March 24 u2013 June 16.  Eight
  species were detected with the ARDs. The southern leopard frog had the highest frequency
  of occurrence and relative abundance followed by green treefrog and squirrel treefrog.
  \ The lowest frequency of occurrence rates and relative abundance were the spring
  peeper and carpenter frog. However, this may be an underestimate due to a lapse
  in recording time in several of the ARDS because of battery malfunction early in
  the season. Amphibians have been recognized as important indicators for environmental
  health.  Many refuges in the South Atlantic ecoregion lack baseline data for amphibians.
  This monitoring will provide baseline data for vocal anurans on the refuge.\",\n\t\"license_title\":
